import { Link } from 'react-router-dom';
import styles from './style.module.css';


interface ItemDropDown {
  title: string,
  url: string,
  childrens?: ItemDropDown[],
}

function NavDropDown({ title, url, childrens }: ItemDropDown) {

  return (<>
    <div className={styles.dropdowBox}>
      <a className={`nav-link ${styles.dropdow}`}>{title}</a>
      <div className={` ${styles.dropdowContent}`}></div>
    </div>
  </>);
}
export default NavDropDown;
